import React, {Component} from 'react';

class HostAttendRate extends Component{
    constructor(){
        super();
        this.state ={
            templeList: {}
        }
        this.parsingData = this.parsingData.bind(this);
    }
    parsingData(){
        const _templeList = his.props.templeList;
        this.setState({
            templeList: this.props.templeList
        });
        for(let key in _templeList){
            console.log(_templeList[key]);
        }
    }
    componentDidMount(){
        parsingData();
    }
    render(){
        return(
            <div id="host_p2_attend_rate" className="main-container">
                <div className="row">
                    <div className="col-md-12">
                        <h3>各壇壇主、講師、副壇主、德字班出席率總表</h3>
                    </div>
                </div>
                <div className="table-list">
                    <div className="row table-border">
                        <div className="col-sm-12 col-md-12 col-lg-12"><h6 className="form-title">舊金山區</h6></div>
                    </div>
                    <div className="row table-border">
                        <div className="col-sm-3 col-md-3 col-lg-3"></div>
                        <div className="col-sm-3 col-md-3 col-lg-3">應到</div>
                        <div className="col-sm-3 col-md-3 col-lg-3">實到</div>
                        <div className="col-sm-3 col-md-3 col-lg-3">出席率</div>
                    </div>

                    <div id="zanDeRate" className="row table-border">
                        <div className="col-sm-3 col-md-3 col-lg-3">沾德壇</div>
                        <div className="col-sm-3 col-md-3 col-lg-3 req"></div>
                        <div className="col-sm-3 col-md-3 col-lg-3 sign bold">00</div>
                        <div className="col-sm-3 col-md-3 col-lg-3 rate bold">00.0%</div>
                    </div>

                    <div id="tolRate" className="row table-border">
                        <div className="col-sm-3 col-md-3 col-lg-3">小計</div>
                        <div className="col-sm-3 col-md-3 col-lg-3 req">00</div>
                        <div className="col-sm-3 col-md-3 col-lg-3 sign bold">00</div>
                        <div className="col-sm-3 col-md-3 col-lg-3 rate bold">00.0%</div>
                    </div>
                </div>
            </div>
        );
    }
}

export default HostAttendRate;
